import time
start_time = time.time()

class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        max_substring_length: int = 0
        char_position_dictionary: dict = {}
        start_of_tested_string: int = 0
        for index, char in enumerate(s):
            start_of_tested_string = max(start_of_tested_string, char_position_dictionary.get(char, 0))
            max_substring_length = max(max_substring_length, index - start_of_tested_string + 1)
            char_position_dictionary[char] = index + 1
        return max_substring_length

